    "using ODE\n",
    "tspan=range(0.0, stop=10.0, length=1000);\n",
    "y0=0.3\n",
    "f(t, y)=y.^2*sin.(exp.(-t.*cos.(1.0*t)*2.0.*y)).*tanh.(t.*y);\n",
    "z=tout, yout=ode23(f, y0, tspan);\n",
    "plot(z)"
   ]
